import React from 'react';

function NewPost(props){
  console.log(props);
  if(props.errPost){
    return(
      <React.Fragment>
        <div className='err-new-post'>Đã xảy ra lỗi khi tạo bài viết. Vui lòng thử lại</div>
      </React.Fragment>
    )
  }

  return(
    <React.Fragment>
      <div className='count-new-post'>{props.newPost.length} bài viết mới đã được đăng</div>
    </React.Fragment>
  )
}

export default NewPost;
